import * as actionType from "../actions/actionType";

const initialState = {
  token: localStorage.getItem("token"),
  isAuthenticated: null,
  isLoading: false,
  user: null,
};

const error = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default error;
